import React, { useState, useEffect } from "react";
import Circle from "./Circle";

function List() {
  const [user, setUser] = useState([]);
  const [peopleInside, setPeopleInside] = useState([]);

  useEffect(() => {
    fetch("https://online.ntnu.no/api/v1/users/?rfid=0260434848")
      .then((res) => res.json())
      .then((res) => setUser(res.results));
  }, []);

  console.log(user);
  return <Circle props={user} />;
}

export default List;
